import React, {Component} from 'react';

class Post extends Component {

    render() {
        let {item,selected} = this.props;
        return (
            <div>
                {item.id}-{item.title} - {item.body}
                <button onClick={()=>selected(item.id)}>click</button>
            </div>
        );
    }
}

export default Post;
